        <!-- main js -->
        <script>
            $( document ).ready(function() {
                // jarallax
                $('.bg_parallax').parallaxScroll({
                  friction: 0.5
                });

                // detect nav
                var $win = $(window);
                var winH = $win.height();
                $win.on("scroll", function () {
                    if ($(this).scrollTop() + 1 > winH ) {
                        $('.nav').addClass("tran_nav");
                    } else {
                        $('.nav').removeClass("tran_nav");
                    }
                }).on("resize", function(){
                   winH = $(this).height();
                });
            });
        </script>
